import React from "react";

//lets just use this as a nonstate based bar
const MBNavBar = () => {
  return (
    <nav className="navbar navbar-dark bg-dark">
      <span className="navbar-text">Meter Beaters React Demo</span>
    </nav>
  );
};

export default MBNavBar;
